import{_ as r,c as t,o as e,ae as n}from"./chunks/framework.CDjunVez.js";const d=JSON.parse('{"title":"QQ空间时光机使用指南","description":"","frontmatter":{},"headers":[],"relativePath":"guide.md","filePath":"guide.md"}'),o={name:"guide.md"};function l(i,a,c,s,p,h){return e(),t("div",null,[...a[0]||(a[0]=[n('<h1 id="qq空间时光机使用指南" tabindex="-1">QQ空间时光机使用指南 <a class="header-anchor" href="#qq空间时光机使用指南" aria-label="Permalink to &quot;QQ空间时光机使用指南&quot;">​</a></h1><p>本工具<strong>QQ空间时光机</strong>（原名：QQ空间恢复导出工具）可以<strong>恢复并导出QQ空间的历史内容</strong>，例如那些你<strong>已经删除</strong>的说说、留言和转发等。</p><p>导出的文件包括：<a href="https://qzone.xuanran.cc/demo/dtnr.html" target="_blank" rel="noreferrer">动态内容</a>、<a href="https://qzone.xuanran.cc/demo/lyb.html" target="_blank" rel="noreferrer">留言板</a>、<a href="https://qzone.xuanran.cc/demo/hdph.html" target="_blank" rel="noreferrer">互动排行</a>、<code>点赞数据.xlsx</code>、<code>访客数据.xlsx</code>、<code>互动排行.xlsx</code>、<code>留言板.xlsx</code>、<code>所有评论.xlsx</code></p><p>（可点击蓝色字体预览已脱敏的示例结果，受限于浏览器跨域限制，在线浏览时部分图片无法正常显示，实际导出后无此问题）</p><blockquote><p><strong>注意</strong>：本工具无法将已删除的内容直接恢复到你的QQ空间中，而是会将数据导出，但无法做到100%与未删除时无差别。</p></blockquote><blockquote><p>作者开发本软件花费了大量时间，因此并<strong>非免费提供</strong>。但只需一杯奶茶的钱即可。</p></blockquote><h2 id="一、软件下载与环境要求" tabindex="-1">一、软件下载与环境要求 <a class="header-anchor" href="#一、软件下载与环境要求" aria-label="Permalink to &quot;一、软件下载与环境要求&quot;">​</a></h2><ul><li><p><strong>软件下载</strong>：</p><ul><li>👉 <a href="https://file.xuanran.cc/qqkjsgj.exe" target="_blank" rel="noreferrer">官方下载地址</a></li><li>👉 <a href="https://www.123865.com/s/fbaCTd-bVk5H" target="_blank" rel="noreferrer">备用下载链接 (123网盘)</a></li><li>👉 复制 [ <a href="https://file.xuanran.cc/qqkjsgj.exe" target="_blank" rel="noreferrer">https://file.xuanran.cc/qqkjsgj.exe</a> ] 到浏览器</li><li>👉 微信QQ内浏览器不支持下载文件，请务必复制到浏览器当中</li></ul></li><li><p><strong>支持环境</strong>：</p><ul><li><code>Windows 10</code> / <code>Windows 11</code></li><li>暂不支持 macOS、Android、iOS</li></ul></li></ul><blockquote><p>本软件为绿色桌面版，无需安装，下载后双击即可运行。</p></blockquote><hr><h2 id="二、启动与授权" tabindex="-1">二、启动与授权 <a class="header-anchor" href="#二、启动与授权" aria-label="Permalink to &quot;二、启动与授权&quot;">​</a></h2><h3 id="_1️⃣-运行程序" tabindex="-1">1️⃣ 运行程序 <a class="header-anchor" href="#_1️⃣-运行程序" aria-label="Permalink to &quot;1️⃣ 运行程序&quot;">​</a></h3><p>下载完成后，找到 <code>.exe</code> 文件并双击启动。</p><blockquote><p>如果系统弹出 “Windows 已保护你的电脑” 或 “来自未知发布者”的安全提示，请点击“更多信息” -&gt; “仍要运行”。</p></blockquote><p><img src="http://pictures.xuanran.cc/i/2025/12/22/69495801234b3.png" alt=""></p><hr><h3 id="_2️⃣-阅读公告" tabindex="-1">2️⃣ 阅读公告 <a class="header-anchor" href="#_2️⃣-阅读公告" aria-label="Permalink to &quot;2️⃣ 阅读公告&quot;">​</a></h3><p>软件启动后会首先展示公告窗口，其中包含一些重要的使用说明和注意事项。阅读后，请点击“继续”进入下一步。</p><p><img src="http://pictures.xuanran.cc/i/2025/12/22/6949582301cc7.png" alt=""></p><hr><h3 id="_3️⃣-扫码登录" tabindex="-1">3️⃣ 扫码登录 <a class="header-anchor" href="#_3️⃣-扫码登录" aria-label="Permalink to &quot;3️⃣ 扫码登录&quot;">​</a></h3><p>接下来，请使用<strong>手机QQ扫描二维码</strong>以完成登录。</p><p><img src="http://pictures.xuanran.cc/i/2025/12/18/6943dd0b2e740.png" alt=""></p><blockquote><p>登录过程安全，与QQ官方扫码登录体验一致，无需担心账号密码泄露。</p></blockquote><hr><h3 id="_4️⃣-权限验证" tabindex="-1">4️⃣ 权限验证 <a class="header-anchor" href="#_4️⃣-权限验证" aria-label="Permalink to &quot;4️⃣ 权限验证&quot;">​</a></h3><p>登录成功后，程序将自动检测你的使用权限。</p><ul><li><strong>已开通权限</strong>：你将直接进入软件主界面。</li><li><strong>未开通权限</strong>：软件会弹出相应的提示窗口。</li></ul><p><img src="http://pictures.xuanran.cc/i/2025/12/18/6943de04276a3.png" alt=""></p><hr><h3 id="_5️⃣-验证成功" tabindex="-1">5️⃣ 验证成功 <a class="header-anchor" href="#_5️⃣-验证成功" aria-label="Permalink to &quot;5️⃣ 验证成功&quot;">​</a></h3><p>成功获取权限后，你将看到如下主界面，代表你的账号已准备就绪。</p><p><img src="http://pictures.xuanran.cc/i/2025/12/18/6943e5d819b38.png" alt=""></p><hr><h2 id="三、导出空间数据" tabindex="-1">三、导出空间数据 <a class="header-anchor" href="#三、导出空间数据" aria-label="Permalink to &quot;三、导出空间数据&quot;">​</a></h2><h3 id="_6️⃣-开始导出" tabindex="-1">6️⃣ 开始导出 <a class="header-anchor" href="#_6️⃣-开始导出" aria-label="Permalink to &quot;6️⃣ 开始导出&quot;">​</a></h3><p>在主界面中，点击中央的 <strong>「开始导出」</strong> 按钮，程序将开始执行数据拉取任务。</p><p><img src="http://pictures.xuanran.cc/i/2025/12/22/694958b66e917.png" alt=""></p><p><strong>导出须知：</strong></p><ul><li><strong>自动化处理</strong>：程序会自动抓取你QQ空间的历史数据。</li><li><strong>手动终止</strong>：你可以随时在导出过程中手动停止任务。</li><li><strong>智能限速</strong>： 防止被腾讯风控，程序内置了请求限速机制和缓存机制。</li><li><strong>所需时间</strong>：导出所需的时间与你空间内容的多少成正比。动态越多、年份越久，耗时越长。</li><li><strong>自动分析</strong>：数据拉取完成后，程序会自动进入分析阶段，无需额外操作。</li></ul><hr><h2 id="四、查看导出结果" tabindex="-1">四、查看导出结果 <a class="header-anchor" href="#四、查看导出结果" aria-label="Permalink to &quot;四、查看导出结果&quot;">​</a></h2><h3 id="_7️⃣-导出成功" tabindex="-1">7️⃣ 导出成功 <a class="header-anchor" href="#_7️⃣-导出成功" aria-label="Permalink to &quot;7️⃣ 导出成功&quot;">​</a></h3><p>当看到“导出完成”的提示时，所有操作均已顺利完成。</p><ul><li><strong>保存位置</strong>：结果会自动保存在你的<strong>电脑桌面</strong>上。</li><li><strong>文件结构</strong>：导出的文件会按QQ号进行分类，内容结构清晰，方便你查阅和整理。</li></ul><p><img src="http://pictures.xuanran.cc/i/2025/12/22/6949590decf47.png" alt=""></p><p><img src="http://pictures.xuanran.cc/i/2025/12/22/6949598476a9e.png" alt=""></p><p><img src="http://pictures.xuanran.cc/i/2025/12/22/69495a33e12ad.png" alt=""></p><p><img src="http://pictures.xuanran.cc/i/2025/12/22/69495aae25691.png" alt=""><img src="http://pictures.xuanran.cc/i/2025/12/22/69495bb0651ca.png" alt=""><img src="http://pictures.xuanran.cc/i/2025/12/22/69495d78afc43.png" alt=""></p><hr><p>你也可以将网页文件通过文件传输助手发送到手机，然后选择其他应用打开 -&gt; 浏览器，在手机上查看结果</p><h2 id="五、补充说明" tabindex="-1">五、补充说明 <a class="header-anchor" href="#五、补充说明" aria-label="Permalink to &quot;五、补充说明&quot;">​</a></h2><ul><li>本工具仅用于<strong>个人 QQ 空间数据备份与恢复</strong></li><li>请勿用于任何违法、违规用途</li><li>导出过程中建议保持网络稳定，避免频繁切换网络</li><li>问题反馈，请通过邮件联系：xuanrandev@qq.com</li></ul>',53)])])}const g=r(o,[["render",l]]);export{d as __pageData,g as default};
